import styled from "styled-components";

const SearchBox = styled.li`
  width: 100%;
  height: 24px;
  background: red;
  .colorBox {
    background: ${(prop) => prop.color || "var(--line-gray)"};
  }
`;

export default function SearchList() {
  return (
    <SearchBox>
      <div className="colorBox" color={"yellow"}></div>
    </SearchBox>
  );
}
